import React from "react";
import "./App.css";
import Menu from "./Menu.js";
import styled from "styled-components";
import Tooltip from "@material-ui/core/Tooltip";
import { withStyles } from "@material-ui/core/styles";
import { MainContainer, StyledDiv1 } from "./styles/App"



const Name = styled.h1`
  color: #353336;
  font-size: 5em;
  text-align: center;
  font-weight: 300;
  margin: 0em;
  @media (max-width: 768px) {
    font-size: 3em;
  }
`;

const StyledDiv2 = styled.div`
background-image: url("https://www.transparenttextures.com/patterns/asfalt-dark.png");
display: flex;
  flex-direction: column;
  flex-wrap: wrap;
  justify-content: center;
  align-items: center;
`;

const Cactus = styled.img`
  width: 12vh;
  height: 20vh;

  transition: transform 1000ms ease-in-out;
  &:hover {
    transform: translate(0, -15px) 
  }
`;

const HtmlTooltip = withStyles(theme => ({
  tooltip: {
    backgroundColor: "#e0e3cf",
    color: "#353336",
    maxWidth: 420,
    fontSize: theme.typography.pxToRem(22),
    border: "none"
  }
}))(Tooltip);


const LinksDiv = styled.div``;

const MenuDiv = styled.div``;

function App() {
  return (
    <MainContainer>
      <StyledDiv1>
        <Name>katherine szelag</Name>
        <HtmlTooltip title="pretty fly for a cacti" placement="right" arrow>
          <Cactus
            alt="cactus"
            src="https://res.cloudinary.com/dpfixnpii/image/upload/v1583344933/cactus_2_i8rsfk.svg"
          />
        </HtmlTooltip>
      </StyledDiv1>
      <StyledDiv2>
        <LinksDiv>
        </LinksDiv>
        <MenuDiv>
        <Menu />
        </MenuDiv>

      </StyledDiv2>
    </MainContainer>
  );
}

export default App;
